import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
// USERS is an array of objects, which we need to convert into JSX (javascript components)
import { users } from "../data";


const employeeTable = users.map((users) =>
<table>
<tr>
  <th>ID:</th>
  <th>{users.name}</th>
  <th>{users.department}</th>
  <th>{users.role}</th>
  <th>{users.email}</th>
</tr>
<tr>
  <td>{users.id}</td>
  <td>$100</td>
</tr>
</table>);

function Headline() {

    return (
        <div>
            {employeeTable}
        </div>
    );
}

